# In dieser Datei können Freischaltungen für bestimmte 
# NetInstall-Produkte vorgenommen werden.
# Dazu sind im ersten Abschnitt der Datei, deren Struktur 
# der einer gewöhnlichen Windows-Ini-Datei analog ist, unter
# [Available Machinegroups] die NetInstall-Pakete mit Namen (vor
# dem "="-Zeichen) so aufgeführt, wie sie in der 
# NetInstall-Installationsoberfläche _nach_ einer Freischaltung
# auf dem entsprechenden Rechner sichtbar sind.

# Die Freischaltung selbst erfolgt durch Einfügen einer neuen Zeile
# unterhalb des mit dem Paketnamen bezeichneten Abschnittes der software,
# die freigeschaltet werden soll.
# In dieser Zeile steht als erstes der Name des Rechners, der 
# freigeschaltet werden soll direkt gefolgt von einem "="-Zeichen, 
# hinter dem ein Kommentar eingetragen werden kann - genügend Beispiele
# finden sich unten; es werden grundsätzlich nur _Rechner_ und _keine_ 
# Accounts freigeschaltet!

# Die Anordnung der einzelnen Sektionen ist nun so, dass am Anfang
# die von IPP bereitgestellten und verwalteten Pakete stehen und am
# Ende diejenigen von IT - beim Einfügen weiterer Maschinengruppen
# bitte ich darum, diese Konvention um der leichteren Bearbeitbarkeit 
# Willen beizubehalten.

# Freischaltungen können auf jeden Fall vom NetInstall-Entwicklerteam
# vorgenommen werden; explizit sind ausserdem aber noch Mitarbeiter/innen
# aus den Gruppen DV-Zeuthen, IPP und IT (UCO) dazu berechtigt.
# Diese Berechtigung wird über die in der Registry verwaltete 
# Sicherheitsgruppe nixnimgr im IT-Namensraum erteilt - weitere 
# Berechtigungen bitte ich, nur in Absprache mit mir zu vergeben.

# Sollte es zu Schwierigkeiten bei der Freigabe kommen, steht
# das NetInstall-Entwicklerteam unter der Mail niteam@desy.de
# zur Verfügung.

# Martin Gloris, 28.01.2005




